					'faq.questionCamDisappear': 'My webcam and microphone settings are resetted each time I launch the software.',
					'faq.answerCamDisappear': 'You have to save the settings by clicking the "save" button.',
					'faq.questionFKeys': 'What is the use of the list containing F1, F2,... in the options?',
					'faq.answerFKeys':
						'In this list you can save short texts, which will be sent to the user by pressing the corresponding F Key. In that way you are able to greet users only by pressing one key. You can also use placeholders to insert the username or the local time.',
					'faq.questionCam2Cam': "Why can't I see the user?",
					'faq.answerCam2Cam':
						'In order to be able to send a stream, the user has to grant access to his cam. By clicking the right mouse button over the livecam stream, he will get a menu where he can grant this access.',
					'faq.questionActivityPin': 'Why do I have to enter the code?',
					'faq.answerActivityPin':
						"If you haven't been typing for a longer period, you have to enter the code. This avoids letting the software accidentally open, even though you are not in front of the cam. If you don't enter the code correctly in time, your stream is stopped.",
					'faq.questionRegularMode': 'What is a Regular Show?',
					'faq.answerRegularMode':
						'A Regular Show can be joined by multiple users at a time. The price per minute has to be set for each portal individually (Profile -> Livecams). It will then be automatically applied.',
					'faq.questionExclusiveMode': 'What is an Exclusive Show?',
					'faq.answerExclusiveMode':
						'An Exclusive Show is limited to one user at a time. It is only possible to have an Exclusive Show at one portal. The price per minute has to be set for each portal individually (Profile -> Livecams). It will then be automatically applied. If you decline an Exclusive Show invitation, the user has to wait a short period of time, before he can send you a new invitation.',
					'faq.questionChangeExclusive': 'What happens if I change the type of the show?',
					'faq.answerChangeExclusive':
						'If you enter an Exclusive Show with a user, all other users are kicked. If you get an Exclusive Show invitation, you only have a short period of time to reply or the invitation is deemed rejected. Furthermore, you can only invite a user to an Exclusive Show once.  ',
					'faq.questionExclusiveActive': 'When is which Exclusive Mode button enabled?',
					'faq.answerExclusiveActive':
						'There are two buttons for the Exclusive Mode.  If there is no livecam user, you can switch the mode with the button "EXCLUSIVE" in the bar below your preview. Otherwise, you can invite a livecam user. Click on the button on the right hand side of the user. A menu will drop down. Finally, click on the star.',
					'faq.questionOneWindowChat': 'What is the "One Chat Tab" layout?',
