					'faq.questionBlackOverlay': 'Why is there a white overlay in my cam stream?',
					'faq.answerBlackOverlay':
						'If a user joins your chat, it may be that he does not see the entire cam picture. The clipped area has a white shadow overlay, so that you can recognize the area of the cam picture the user actually sees. This area can be different from user to user dependent on their monitor resolution, so it switches when you switch between the users. If the image section changes at the user, it also changes after a short time in the software.',
